class Admin extends React.Component {

    render() {
        return (
            <div  className="admin">
                <Navbar/>
                <AddCard/>
                <div className="card-group ">





     <div></div>

      <Card>
        <CardImg top width="100%" src={Image} alt="Card image cap" />
        <CardBody>
          <CardTitle>Card title</CardTitle>
          <CardSubtitle>Card subtitle</CardSubtitle>
